define("works/collections/applet_activities",function(require){var e=require("backbone"),t=require("app"),n=require("works/models/applet_activity");return e.Collection.extend({model:n,initialize:function(e){this.options=e||{},this.appletId=e.appletId,this.docId=e.docId,this.reqAppletId=e.reqAppletId},url:function(){return this.reqAppletId?t.config("contextRoot")+"api/works/applets/"+this.reqAppletId+"/refer/"+this.appletId+"/doc/"+this.docId+"/activity":t.config("contextRoot")+"api/works/applets/"+this.appletId+"/docs/"+this.docId+"/activity"}})});